// axiosConfig.js
import axios from 'axios';

const axiosInstance = axios.create({
    baseURL: 'http://172.25.0.4:8080/api', // Set your base URL
    headers: {
        'Content-Type': 'application/json',
    },
});

export default axiosInstance;
